static char *getstr8(const uint8_t **pp, const uint8_t *p_end)

{

    int len;

    const uint8_t *p;

    char *str;



    p   = *pp;

    len = get8(&p, p_end);

    if (len < 0)

        return NULL;

    if ((p + len) > p_end)

        return NULL;

    str = av_malloc(len + 1);

    if (!str)

        return NULL;

    memcpy(str, p, len);

    str[len] = '\0';

    p  += len;

    *pp = p;

    return str;

}

